import { Button, Grid, Card, CardContent } from "@mui/material";
import React from "react";
import { useNavigate } from "react-router-dom";
import "./common.css";

export const Home = () => {
  const navigate = useNavigate();
  //   const handleClick = () => {
  //     navigate("/login");
  //   };
  return (
    <Grid container spacing={2}>
      <Grid item xs={12}>
        <img
          className="photo"
          src="https://media.istockphoto.com/id/1499814881/photo/sorting-pharmaceutical-capsules-by-a-sorting-machine-on-a-production-line.jpg?s=612x612&w=0&k=20&c=JPJzEW8SijY5nwBMi6IqLwlO_RHmK4UUb406ZN-5bCs="
          alt=""
        />
      </Grid>
      <Grid container spacing={2}>
        <Grid item xs={4}></Grid>
        <Grid item xs={4} style={{ position: "relative", top: "-60px" }}>
          <h1>jjii</h1>
        </Grid>
        <Grid item xs={4}></Grid>
      </Grid>
    </Grid>
  );
};
